    if n not in [1, 2, 4]:
        return -1
    elif n == 3:
        return (1, 0, 0)
    else:
        k = n // 5 - 1
        n = n - 5 * k
        if n == 5:
            return (0, k + 1, 0)
        elif n == 6:
            return (2, k, 0)
        elif n == 7:
            return (0, k, 1)
        elif n == 8:
            return (1, k + 1, 0)
        elif n == 9:
            return (3, k, 0)
        else:
            return -1

